description:
Couche géographique décrivant les panneaux de signalisation vélo sur le territoire communal de Nanterre.
Elle se compose des attributs suivants :
- Identifiant [OBJECTID];
- Identifiant ville [ID];
- Identifiant de de la signalisation lumineuse tricolore auquel le panneau est rattaché [ID_RTGE_SLT];
- Identifiant du carrefour [ID_CARREFOUR];
- Type de panneau [TYPE];
- Placement [PLACEMENT];
- Angle de position [ANGLE].
Pour plus d’informations : [site internet ville de Nanterre](https://www.nanterre.fr/)

Couche géographique décrivant le réseau cyclable sur le territoire communal de Nanterre.
Elle se compose des attributs suivants : 
- Identifiant [OBJECTID];
- Nature [NATURE];
- Type d'aménagement[TYPE];
- Type d'aménagement développé [TYPE_DEV];
- Restriction de circulation [RESTRICTION_CIRC];
- Numéro d'arrêté [NUM_ARRETE];
- Date d'arrêté [DATE_ARRETE];
- Date de création [DATE_CREATION];
- Symbologie [SYMBOLOGIE].
Pour plus d’informations : [site internet ville de Nanterre](https://www.nanterre.fr/)

Pour les PPR naturels, le code de l'environnement définit deux catégories de zones (L562-1) : les zones exposées aux risques et les zones qui ne sont pas directement exposées aux risques mais sur lesquelles des mesures peuvent être prévues pour éviter d'aggraver le risque.
En fonction du niveau d'aléa, chaque zone fait l'objet d'un règlement opposable. Les règlements distinguent généralement trois types de zones :
1- les « zones d'interdiction de construire », dites « zones rouges », lorsque le niveau d'aléa est fort et que la règle générale est l'interdiction de construire ;
2- les « zones soumises à prescriptions », dites « zones bleues », lorsque le niveau d'aléa est moyen et que les projets sont soumis à des prescriptions adaptées au type d'enjeu ;
3- les zones non directement exposées aux risques mais où des constructions, des ouvrages, des aménagements ou des exploitations agricoles, forestières, artisanales, commerciales ou industrielles pourraient aggraver des risques ou en provoquer de nouveaux, soumises à interdictions ou prescriptions (cf. article L562-1 du Code de l'environnement) . Cette dernière catégorie ne s'applique qu'aux PPR naturels.

Muséofile répertorie les « musées de France » (plus de 1 200) au sens du Code du Patrimoine.
Pour chaque « Musée de France » sont indiqués, notamment : le nom officiel, les adresses postale et Internet, le numéro de téléphone, les informations de géolocalisation, un bref historique du musée et de ses collections, les principales thématiques des collections…
Le répertoire est accessible sur la Plateforme Ouverte du Patrimoine.
Les données de la base Muséofile sont liées à celles des bases Joconde, catalogue collectif des collections des musées de France, et Mérimée.
Vous pouvez en savoir plus sur la rubrique thématique Musées du site du ministère de la culture.
Dictionnaire des variables :
REF : Identifiant du musée ;
NOMOFF : Nom officiel du musée ;
AUTNOM remplace NOMUSAGE : Nom d’usage du musée ;
ADRL1_M : Adresse (ligne 1) ;
LIEU_M : Adresse (ligne 2) ;
CP_M : Code Postal ;
VILLE_M : Ville ;
DPT : Département ;
REGION : Région ;
URL_M : Adresse du site ou de la page du site internet ;
TEL_M : Téléphone générique du musée ;
CATEG : Catégorie spécifique de musée ;
DOMPAL : Principaux domaines thématiques des collections ;
HIST : Histoire de la collection ;
ATOUT : Atouts de la collection ;
THEMES : Détails des domaines thématiques des collections ;
ARTISTE : Artistes phares de la collection ;
PHARE : Personnages phares de la collection ;
INTERET : Caractéristique architecturale du bâtiment ;
PROT-BAT : Type de protection du bâtiment ;
PROT-ESP : Type de protection de l’espace ;
REFMER : référence dans la base Mérimée ;
AN-CREAT : année de création ;
DMAJ : Date de dernière mise à jour de l’information ;
Latitude ;
Longitude.
**INFORMATION** : LE JEU DE DONNÉES EST DISPONIBLE EN TROIS FORMATS (.XLSX, .CSV ET *.GPKG). LE NOMBRE D'ENREGISTREMENTS EST DE L'ORDRE DE : 7
